import '../styles/App.scss';
import data from '../data/clubs.json';
import { render } from 'node-sass';

function App() {
  console.log(data);
  const renderClubs = data.map((oneClub, index) => (
    <li key={index}>
      <h3>{data.name}</h3>
      <p>Abierto entre semana:{data.openOnWeekdays}</p>
      <p>Abierto el fin de semana:{data.openOnWeekend}</p>
    </li>
  ));
  return (
    <div>
      <header>
        <h1>Mis Clubs</h1>
      </header>
      {/*Clubs*/}
      <ul>{renderClubs}</ul>
      <main></main>
    </div>
  );
}

export default App;
